import React from 'react';
import Style from "./Quiz.module.css";

const Quiz = ({name, score, setScore, questions}) => {
    return (
        <div>
            <span>Welcome {name}</span>
            <span>Current Score : {score}</span>

        </div>
    )
}

export default Quiz
